import React from "react";
import { useSelector } from "react-redux";
import { store } from "../store/store";

import Country from "../components/Country";
import "../css/Sidebar.css";

const Favorites = () => {
  const favs = useSelector(state.favorites.favorites);

  const { users, isLoading } = useSelector(state => state.users);
  //   const favs = store.getState().favorites.favorites;

  return (
    <div>
      {favs.map(country => (
        <div className="favs-section">
          <li key={country.countryCode} className="countries-section">
            <Country country={country} fav="remove" />
          </li>
        </div>
      ))}
    </div>
  );
};

export default Favorites;
